import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class ExercisesList extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
      <h3>Welcome to the student home page!</h3>
      <p>Please choose an action from the list below.</p>
        <ul>
          <li><Link to="/addAnswer">Add Answer</Link></li>
        </ul>
    </div>
    )
  }
}
